import { Component } from 'react';
import  './App.css';

class App extends Component{
  constructor(){
super();
this.state = {
  monster: []
}
  }
  componentDidMount(){
    fetch('https://jsonplaceholder.typicode.com/users')
    .then(Response => Response.json())
    .then(users => this.setState({ monster : users}))
  }
  render(){
    return(
      <div className="App">
     {
       this.state.monster.map(monster => 
       <h1 key={monster.id}>
         {monster.name}
         </h1>)
     }
    </div>
    )
  }
}

export default App;
